.react-tabs {
  flex: 1;
  display: flex;
  flex-direction: column;
}
.react-tabs__tab-panel--selected {
  flex: 1;
  overflow: auto;
}
.github-tab {
  padding: 5px 15px;
  text-align: center;
  font-weight: 600;
  color: #8c8c8c;
  cursor: default;
  user-select: none;
}
.github-tablist {
  flex: none;
  display: flex;
  justify-content: center;
  padding: 0;
  margin: 0;
  list-style: none;
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
  background-color: #333;
}
.github-tab-icon {
  color: #5a5a5a;
  vertical-align: middle;
}
.github-tab-icon:before {
  margin-right: .4em;
}
.github-tab-count {
  display: inline-block;
  background-color: #3a3a3a;
  border-radius: 2px;
  padding: 0 .25em;
  margin-left: 5px;
}
.github-tab.react-tabs__tab--selected {
  color: #fff;
  box-shadow: 0 1px 0 #5c6064;
}
.github-tab.react-tabs__tab--selected .github-tab-icon {
  color: #aaa;
}
